import React from 'react';
import Header from './Header.js';
import Footer from './Footer.js';

function Register() {
  return (
          <div className="modal__container">
            <h2 className="modal__title">Регистрация</h2>
            <form className="modal__form" action="#" noValidate>
              <label>
                <input type="text" value="" className="modal__item modal__item_type_name" name="email" placeholder="Email" required minLength="2" maxLength="40" />
                <span id="email-error" className="modal__item-error"></span>
              </label>
              <label>
                <input type="password" value="" className="modal__item modal__item_type_profession" name="password" placeholder="Пароль" required minLength="2" maxLength="200" />
                <span id="password-error" className="modal__item-error"></span>
              </label>
              <button type="submit" className="modal__button modal__button_action">Зарегистрироваться</button>
            </form>
          </div>

  );
}

export default Register;
